run Positive3 {
    some disj E1, T1, J1, E2: Track | some disj S1, Sem1: Signal {
        Track = E1 + T1 + J1 + E2
        Signal = S1 + Sem1
        // E1 and T1 both lead to junction J1, which leads to exit E2.
        succs = E1->J1 + T1->J1 + J1->E2
        // E1 and T1 are entries.
        Entry = E1 + T1
        // E2 is the exit.
        Exit = E2
        // J1 is a junction.
        Junction = J1
        // Both entries have speed signals.
        Speed = S1
        // Both tracks before the junction (E1, T1) have semaphores.
        Semaphore = Sem1
        signals = E1->S1 + E1->Sem1 + T1->S1 + T1->Sem1
    }
} for 4 Track, 2 Signal expect 1

